import React from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart, registerables } from 'chart.js';
Chart.register(...registerables);

const CombinedBarChart = ({ datasets }) => {
  let chartData = {
    labels: [],
    datasets: [],
  };

  if (datasets && datasets.length > 0) {
    const labels = datasets[0].data.map(entry => entry.date);

    const dataSetsConfig = datasets.map((dataset, index) => ({
      label: `Data ${index + 1}`,
      backgroundColor: dataset.color,
      data: dataset.data.map(entry => entry.totalInvocations),
    }));

    chartData = {
      labels,
      datasets: dataSetsConfig,
    };
  }

  const options = {
    indexAxis: 'y',
    scales: {
      x: {
        stacked: true,
        beginAtZero: true,
      },
      y: {
        stacked: true,
        ticks: {
          autoSkip: false,
        },
      },
    },
  };

  return (
    <div className="combined-bar-chart">
      <Bar data={chartData} options={options} />
    </div>
  );
};

export default CombinedBarChart;
